var TabFormatter=function(){var e={};return e.format=function(e,t,n,r,i,s){n=n||" ",r=r||1,i=i||"",s=s||"";var o=e.split("\n"),u="";for(var a=0;a<o.length;a++){var f=0,l=0;o[a]=o[a].replace(/\t/g,function(e,o,u){var a=o+l-f,c=a%t,h="";for(var p=0;p<t-c;p++)h+=n,l+=r;return f++,i+h+s})}return o.join("\n")},e}();